import React, { Component } from "react";
import ReactDOM from 'react-dom';
import logo from '../acons3.png';

class Recipients extends React.Component {

    state = {
        isLoading: true,
        groups: []
    };

    async componentDidMount() {
        const response = await fetch('/api/recipients');
        const body = await response.json();
        this.setState({ recipients: body, isLoading: false });
    }

    async componentDidMount() {
        const response = await fetch('/api/details');
        const body = await response.json();
        this.setState({ details: body, isLoading: false });
    }

    render() {
        const { recipients, isLoading } = this.state;

        if (isLoading) {
            return <p>Loading...</p>;
        }

        return (
            <div className="App">
                <header className="App-header">
                    <img src={logo} className="App-logo" alt="logo" />
                    <div className="App-intro">
                        <h2>JUG List</h2>
                        {recipients.map(recipients =>
                            <div key={recipients.pk_recipient_id}>
                                <td>{recipients.pk_recipient_id}</td>
                                <td>{recipients.fk_user_id}</td>
                            </div>
                        )}
                    </div>
                </header>
            </div>
        );
    }
}

export default Recipients;
